        <section id="services">
            <h2>خدماتنا في Rezadok</h2>
            <div class="services-container">

                <!-- خدمة 1 -->
                <div class="service-card">
                <i class="service-icon fas fa-calendar-check"></i>
                <h3>حجز مواعيد الأطباء بسهولة</h3>
                <p>نقدم لك منصة متكاملة تتيح لك حجز المواعيد مع الأطباء بجميع التخصصات بطريقة سهلة وسريعة جداً.</p>
                </div>

                <!-- خدمة 2 -->
                <div class="service-card">
                <i class="service-icon fas fa-calendar-day"></i>
                <h3>إدارة وتنظيم المواعيد</h3>
                <p>تمكين الأطباء والمرضى من جدولة، تعديل، أو إلغاء المواعيد بكل سهولة عبر لوحة تحكم ذكية.</p>
                </div>
                <!-- خدمة 4 -->
                <div class="service-card">
